Audience::GenderEnum Audience::toGenderEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("MALE")) {
        return GenderEnum::MALE;
    }
    
    if (value == utility::conversions::to_string_t("FEMALE")) {
        return GenderEnum::FEMALE;
    }
    
    if (value == utility::conversions::to_string_t("ANY")) {
        return GenderEnum::ANY;
    }
    
    throw std::invalid_argument("Invalid value for conversion to GenderEnum");
}


const utility::string_t Audience::fromGenderEnum(const GenderEnum value) const
{
    switch(value)
    {
        
        case GenderEnum::MALE: return utility::conversions::to_string_t("MALE");
        
        case GenderEnum::FEMALE: return utility::conversions::to_string_t("FEMALE");
        
        case GenderEnum::ANY: return utility::conversions::to_string_t("ANY");
        
    }
}

